import * as React from "react";

type Winner = 1 | 2 | null;

export type TFootProps = {
    winner: Winner
  };

const TFoot: React.FC<TFootProps> = tFootProps => {
    return (
        <tfoot>
            <tr>
                <td colSpan={3}>
                {" "}
                </td>
            </tr>
        </tfoot>
    );
};

export default TFoot;
